import { Outlet } from "react-router-dom";

function Favorites() {
  return (
    <div className="favorites">
      <div class="container">
        <h1 className="text-center mt-5">Favorites</h1>
        <Outlet />
      </div>
    </div>
  );
}

export default Favorites;
